import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './components/home/home.js';
import Login from './components/login/Login.js';
import Signup from './components/login/Signup.js';
import AdHome from './components/admin/AdHome.js';
import AdBookform from './components/admin/newbook/AdBookform.js';
import AdBookdata from './components/admin/newbook/AdBookdata.js';
import AdBookUpdate from './components/admin/newbook/AdBookUpdate.js';
import Newarrivals from './components/home/Newarrivals.js';
import Interbookform from './components/admin/internationalbook/Interbookform.js';
import Interbookdata from './components/admin/internationalbook/interbookdata.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Signup/>}/>
        <Route path='/login' element={<Login/>}/>
        <Route path='/home' element={<Home/>}/>
        <Route path='/newarrivals' element={<Newarrivals/>}/>

        <Route path='/adminhome' element={<AdHome/>}/>
        <Route path='/newbookform' element={<AdBookform/>}/>
        <Route path='/newbookdata' element={<AdBookdata/>}/>
        <Route path='/newbookupdate/:id' element={<AdBookUpdate/>}/>

        <Route path='/interbookform' element={<Interbookform/>}/>
        <Route path='/interbookdata' element={<Interbookdata/>}/>



      </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
